var bean=$.parseJSON($.base64.decode(jsonObject));function historyBack(){history.go(-1)}var getPageParam=function(b){var a;document.URL.split("#").forEach(function(c){if(b==c.split(":")[0]){a=c.split(":")[1]}});return a};$(document).ready(function(){var d=bean.link.list;var c=getPageParam("page");if(document.URL.indexOf("#page:")){if(typeof c!=="undefined"){d=bean.link.list+"#page:"+c}}$("#btn_list").click(function(){$(location).attr("href",d)});$("#btn_write").click(function(){$(location).attr("href",bean.link.write)});for(var b in bean.data){var a=bean.data[b]+"";a=a.replace(/\\'/gi,"'");a=a.replace(/\\"/gi,'"');a=a.replace(/\\r\\n/gi,"<br />");if(bean.data[b]){$("span#"+b).html(a)}}if(bean.result<1){$("body").viewDialogMessage("<p>"+bean.resultMsg+"</p>",historyBack)}});